  false,\n\t\"url\": null,\n\t\"notes\": \"This Narrative Report for Malheur National
  Wildlife Refuge summarizes refuge activities from January through April of 1954.
  \ The report begins with general information about the yearu2019s weather conditions,
  water conditions, and fires.  Wildlife- including migratory birds, upland game birds,
  big game animals, fur animals, predators, rodents, other mammals, predaceous birds,
  and fish- is also covered.  The report includes a refuge development and maintenance
  section which discusses physical developments and plantings.  Economic uses of the
  refuge are outlined; grazing is the primary use.  A progress report on field investigations
  and applied research is also included.  The public relations section of the report
  discusses refuge visitors and refuge participation.  Finally, items of interest,
  photographs, and N-R forms are provided.\",\n\t\"license_title\": \"License Not
